  [],\n\t\"revision_timestamp\": \"2015-05-06T21:58:17.599501\",\n\t\"name\": \"advanced-3d-object-identification-system-project\",\n\t\"isopen\":
  true,\n\t\"url\": null,\n\t\"notes\": \"Optra will build an Advanced 3D Object Identification
  System utilizing three or more high resolution imagers spaced around a launch platform.
  \ Data from each imager will be analyzed in real time using a complex morphological
  image processing scheme to extract up to 100 objects of interest.  These objects
  will then be individually tracked in the field-of-view of each imager then correlated
  between imagers to produce an accurate three-dimensional trajectory of each object
  with estimated ground impact position.  Information from each imager's field-of-view
  is then be used to discern object size and shape information.  The system is designed
  to be completely automated from launch through failure.   The primary focus of the
  Phase I effort is development of the image processing algorithms involved with detecting,
  tracking, and identifying the objects of interest.  The algorithms will be further
  refined during the Phase II effort and a prototype of the system will be built.
  \ Phase II preliminary field tests are planned in which recreational parachutists
  leaving an aircraft will be tracked and imaged from two stations. These tests will
  prepare the equipment and personnel for the recorded observation of a live rocket
  launch, with booster or stage separation, near the end of the program.\",\n\t\"license_title\":
